import React, { Component } from 'react';
import { connect } from 'react-redux';
import { compose } from 'redux';
import { firebaseConnect } from 'react-redux-firebase';
import { withRouter } from 'react-router-dom';

import Navbar from 'components/Navbar';

class NavigationBar extends Component {
  render() {
    var links = [
      { to: '/app', icon: 'home', text: 'Home' },
      { to: '/app/profile', text: 'Profile', icon: 'user' },
      {
        to: '/app/survey',
        icon: 'th-list',
        text: 'Survey',
      },
      {
        to: '/app/results',
        icon: 'poll-h',
        text: 'Matches',
      },
      {
        to: '/app/stats',
        icon: 'chart-area',
        text: 'Stats',
      },
      {
        to: '/app/team',
        icon: 'users',
        text: 'Team',
      },
      { to: '/app/faq', icon: 'question', tooltip: 'homepage', text: 'FAQ' },
      {
        to: '/app/archives',
        icon: 'archive',
        text: 'Archives',
      },
    ];

    if (this.props.admin) {
      links.push({
        to: '/app/admin',
        text: 'Admin',
        icon: 'toolbox',
      });
    }

    const { location, logoutUser } = this.props;

    return (
      <Navbar
        links={links}
        logoutUser={logoutUser}
        pathname={location.pathname}
        settingsURL="/app/settings"
      />
    );
  }
}

function mapStateToProps(state, props) {
  return {
    admin: state.firebase.profile.admin,
    logoutUser: props.firebase.logout,
  };
}

export default compose(
  firebaseConnect(),
  withRouter,
  connect(mapStateToProps),
)(NavigationBar);
